import styled from "styled-components";

export const Container = styled.div`
    width: 100%;
    height: 200px;
    display: flex;
    align-items: center;
    justify-content: center;
`;

export const FollowerPicture = styled.img`
    width: 130px;
    height: 130px;
    border-radius: 100%;
    border: 1px solid #fff;
`;
